import './App.css';
import * as Components from '../components';
import {Routes, Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={ Components.MiniGame } />
        <Route path="/leena" element={ Components.Leena } />
        <Route path="/loyalty" element={ Components.Loyalty } />
      </Routes>
